<!DOCTYPE html>
<html lang="en">
<head>
	<meta charset="UTF-8">
	<title>symbol</title>
</head>
<body>
	
</body>
<script>
	let s1 = Symbol('rose');
	let s2 = Symbol('jack');
	let obj = {
		name:'jenny',
		[s1]:'rose',
		[s2]:'jack'
	}
	
	console.log(obj);
	console.log(obj[s1]);
	console.log(obj[s2]);
	console.log(Reflect.ownKeys(obj));

	let keys = Reflect.ownKeys(obj);
	for(let key in keys){
		// console.log(keys[key]);
		console.log(obj[keys[key]]);
	}
</script>
</html>
